def tri(n):
    """Return the first n + 1 numbers of the Tribonacci sequence."""
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    elif n % 2 == 0:
        trib = [1, 3] + [0] * (n - 1)
        for i in range(2, n + 1):
            if i % 2 == 0:
                trib[i] = 1 + (i / 2)
            else:
                trib[i] = trib[i - 1] + trib[i - 2] + trib[i - 3]
        return trib
    else:
        trib = [1, 3] + [0] * n
        for i in range(2, n + 1):
            if i % 2 == 0:
                trib[i] = 1 + (i / 2)
            else:
                trib[i] = trib[i - 1] + trib[i - 2] + trib[i - 3]
        return trib

def minPath(grid, k):
    from heapq import heappush, heappop

    N = len(grid)
    # Create a priority queue to store paths with their cost (sum of values), current position and path length
    pq = []
    # Initialize the priority queue with all possible starting positions
    for i in range(N):
        for j in range(N):
            heappush(pq, (grid[i][j], i, j, [grid[i][j]]))

    # Helper function to get valid neighbors
    def neighbors(x, y):
        for dx, dy in [(1, 0), (0, 1), (-1, 0), (0, -1)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                yield nx, ny

    while pq:
        cost, x, y, path = heappop(pq)
        if len(path) == k:
            return path
        for nx, ny in neighbors(x, y):
            # Extend the current path to each neighbor
            new_path = path + [grid[nx][ny]]
            # Calculate the new cost (not necessarily needed for correctness but included for completeness)
            new_cost = cost + grid[nx][ny]
            heappush(pq, (new_cost, nx, ny, new_path))

    return []

