def encode(message):
    def shift_vowel(vowel):
        vowels = 'aeiouAEIOU'
        shift = 2
        if vowel in vowels:
            is_upper = vowel.isupper()
            index = vowels.index(vowel) + shift
            if index >= len(vowels) // 2:
                index = index % (len(vowels) // 2)
            shifted_vowel = vowels[index]
            return shifted_vowel.upper() if is_upper else shifted_vowel.lower()
        else:
            return vowel

    encoded_message = ''
    for char in message:
        if char.lower() in 'aeiou':
            encoded_message += shift_vowel(char).swapcase()
        else:
            encoded_message += char.swapcase()
    return encoded_message

