def minPath(grid, k):
    N = len(grid)
    # Find the cell with the minimum value and its coordinates
    min_val, min_x, min_y = min((grid[i][j], i, j) for i in range(N) for j in range(N))

    # If k is 1, simply return the minimum value
    if k == 1:
        return [min_val]

    # Initialize the path with the minimum value
    path = [min_val]

    # Find the adjacent cell with the smallest value to oscillate between
    adj_min_val = float('inf')
    for dx, dy in [(0, 1), (1, 0), (-1, 0), (0, -1)]:
        nx, ny = min_x + dx, min_y + dy
        if 0 <= nx < N and 0 <= ny < N:
            if grid[nx][ny] < adj_min_val:
                adj_min_val, adj_x, adj_y = grid[nx][ny], nx, ny

    # Oscillate between the minimum value and its smallest adjacent value
    for _ in range(1, k):
        if len(path) % 2 == 1:
            path.append(adj_min_val)
        else:
            path.append(min_val)

    return path

