        vowels_lower = 'aeiou'
        vowels_upper = 'AEIOU'
        shift = 2
        if vowel.islower() and vowel in vowels_lower:
            return vowels_lower[(vowels_lower.index(vowel) + shift) % len(vowels_lower)]
        elif vowel.isupper() and vowel in vowels_upper:
            return vowels_upper[(vowels_upper.index(vowel) + shift) % len(vowels_upper)]
        return vowel

    def swap_case_and_shift(ch):
        if ch.isalpha():
            ch = shift_vowel(ch)
            if ch.islower():
