        # Mapping vowels to two places ahead in the alphabet, considering case
        vowel_map = {'a': 'c', 'e': 'g', 'i': 'k', 'o': 'm', 'u': 'w',
                     'A': 'C', 'E': 'G', 'I': 'K', 'O': 'M', 'U': 'W'}
        return vowel_map.get(vowel, vowel)

    encoded_message = ''
    for char in message:
        if char in 'aeiouAEIOU':
            # Shift vowels according to the map
