def tri(n):
    """Return the first n + 1 numbers of the Tribonacci sequence."""
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    elif n == 2:
        return [1, 3, 2]

    # Initialize the sequence with correct base cases
    trib = [1, 3, 2]
    while len(trib) <= n:
        # Calculate the next value based on the recurrence relation
        next_val = trib[-1] + trib[-2] + trib[-3]
        trib.append(next_val)

    return trib

