        return [1]
    elif n == 1:
        return [1, 3]
    elif n == 2:
        return [1, 3, 2]
    trib = [1, 3, 2]  # Initial values for n=0, n=1, and n=2
    while len(trib) <= n:
        if len(trib) % 2 == 0:
            trib.append(1 + len(trib) // 2)
        else:
            trib.append(trib[-1] + trib[-2] + trib[-3])
    return trib

def minPath(grid, k):
    from heapq import heappush, heappop

    N = len(grid)
    pos = {grid[i][j]: (i, j) for i in range(N) for j in range(N)}
    heap = [(0, 1, pos[1], [1])]  # (cost, steps, position, path)
    visited = set()

    while heap:
        cost, steps, (x, y), path = heappop(heap)
        if steps == k:
            return path
        if (x, y, steps) in visited:
            continue
        visited.add((x, y, steps))

        for dx, dy in [(0, 1), (1, 0), (-1, 0), (0, -1)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                next_value = grid[nx][ny]
                new_path = path + [next_value]
                heappush(heap, (cost, steps + 1, (nx, ny), new_path))

