def match_parens(lst):
    str1, str2 = lst
    # Calculate the net parentheses count for both strings
    net1 = str1.count('(') - str1.count(')')
    net2 = str2.count('(') - str2.count(')')

    # If both strings have more closing than opening parentheses or vice versa, it's not possible to balance
    if (net1 < 0 and net2 < 0) or (net1 > 0 and net2 > 0):
        return 'No'

    # If the first string has more opening than closing parentheses,
    # the second string must start with enough closing parentheses to balance
    if net1 > 0:
        closing_needed = net1
        for char in str2:
            if char == ')':
                closing_needed -= 1
                if closing_needed == 0:
                    break
            else:  # If we encounter an opening parenthesis before balancing, it's not possible
                if closing_needed > 0:
                    return 'No'
                break

    # Similarly, if the first string has more closing than opening parentheses,
    # the second string must not start with an opening parenthesis unless the first can balance it
    elif net1 < 0:
        opening_needed = -net1
        for char in str1[::-1]:  # Check from the end of str1
            if char == '(':
                opening_needed -= 1
                if opening_needed == 0:
                    break
            else:  # If we encounter a closing parenthesis before balancing, it's not possible
                if opening_needed > 0:
                    return 'No'
                break

    # If none of the above conditions are met, the strings can potentially be balanced
    return 'Yes'

