def tri(n):
    # Correct definition of the Tribonacci sequence
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    elif n == 2:
        return [1, 3, 2]

    # Initialize the sequence with the first three numbers
    trib = [1, 3, 2]
    for i in range(3, n + 1):
        # The next number is the sum of the previous three numbers
        next_value = trib[i-1] + trib[i-2] + trib[i-3]
        trib.append(next_value)

    return trib

