from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    heap = []
    visited = set()

    # Initialize heap with positions and their values
    for i in range(N):
        for j in range(N):
            heappush(heap, ([grid[i][j]], i, j))

    while heap:
        path, x, y = heappop(heap)
        if (x, y, len(path)) in visited:  # Check if this state was already visited
            continue
        visited.add((x, y, len(path)))

        if len(path) == k:
            return path

        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                newPath = path + [grid[nx][ny]]
                heappush(heap, (newPath, nx, ny))

def match_parens(lst):
    str1, str2 = lst
    # Calculate net balance of parentheses for both strings
    balance1 = str1.count('(') - str1.count(')')
    balance2 = str2.count('(') - str2.count(')')

    # If the total balance of parentheses is not zero, it's impossible to form a good string
    if balance1 + balance2 != 0:
        return 'No'

    # If both strings have a non-negative or non-positive balance, check individual string validity
    if (balance1 >= 0 and balance2 >= 0) or (balance1 <= 0 and balance2 <= 0):
        # Check if each string can stand alone as a good string
        def is_good(s):
            balance = 0
            for char in s:
                if char == '(':
                    balance += 1
                else:
                    balance -= 1
                if balance < 0:
                    return False
            return True

        # If both strings are individually good, their concatenation in any order is also good
        if is_good(str1) and is_good(str2):
            return 'Yes'
        return 'No'

    # If one string has a positive balance and the other has a negative balance, ensure the one with
    # the negative balance is checked first to see if it starts with an excess of closing parentheses
    if balance1 > 0:
        str1, str2 = str2, str1
        balance1, balance2 = balance2, balance1

    # Check if str1 starts with more closing parentheses than it has opening ones before it gets balanced
    open_needed = 0
    for char in str1:
        if char == '(':
            open_needed -= 1
        else:
            open_needed += 1
        if open_needed > 0:  # More closing parentheses than opening ones available
            return 'No'

    return 'Yes'

