    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    elif n == 2:
        return [1, 3, 2]

    trib = [1, 3, 2]  # Corrected initial values based on the given recurrence
    for i in range(3, n + 1):
        if i % 2 == 0:  # Adjusted condition for even n
            next_value = 1 + i / 2
        else:
            next_value = trib[i - 1] + trib[i - 2] + trib[i - 3]
        trib.append(next_value)
    return trib

def is_nested(string):
    '''
    Create a function that takes a string as input which contains only square brackets.
    The function should return True if and only if there is a valid subsequence of brackets 
    where at least one bracket in the subsequence is nested.
    '''
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if not stack:
                return False  # Early return if there's an unmatched closing bracket
            stack.pop()
            if not stack:
                return False  # If stack is empty after pop, the brackets are not nested
        else:
            return False  # Invalid character found
    return len(stack) == 0  # Ensure all brackets are matched

