    # Calculate net parentheses count for both strings and the minimum open parentheses needed
    net1 = str1.count('(') - str1.count(')')
    min_open1 = 0
    open_count = 0
    for char in str1:
        if char == '(':
            open_count += 1
        else:
            open_count -= 1
        min_open1 = min(min_open1, open_count)

    net2 = str2.count('(') - str2.count(')')
    min_open2 = 0
    open_count = 0
    for char in str2:
        if char == '(':
            open_count += 1
        else:
            open_count -= 1
        min_open2 = min(min_open2, open_count)

    # If the total net count of parentheses is not zero, it's not possible to balance
    if net1 + net2 != 0:
        return 'No'

    # Check if combining strings in one order or the other is possible without causing imbalance
    if min_open1 + net2 >= 0 or min_open2 + net1 >= 0:
        return 'Yes'
    else:
        return 'No'

