def compare_one(a, b):
    def convert(val):
        if isinstance(val, str):
            val = val.replace(',', '.')
        return float(val)

    a_converted = convert(a)
    b_converted = convert(b)

    if a_converted > b_converted:
        return a
    elif b_converted > a_converted:
        return b
    else:
        return None

def special_factorial(n):
    def factorial(x):
        if x == 0:
            return 1
        else:
            return x * factorial(x-1)

    result = 1
    for i in range(1, n + 1):
        result *= factorial(i)
    return result

