def intersection(interval1, interval2):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    start1, end1 = interval1
    start2, end2 = interval2
    start = max(start1, start2)
    end = min(end1, end2)
    if start > end:
        return "NO"
    # Correcting the length calculation for the intersection
    length = end - start
    return "YES" if is_prime(length) else "NO"

def get_closest_vowel(word):
    vowels = "aeiouAEIOU"
    closest_vowel = ""
    for i in range(len(word) - 2, 0, -1):
        if word[i] in vowels:
            if word[i-1].lower() not in vowels.lower() and word[i+1].lower() not in vowels.lower():
                closest_vowel = word[i]
                break
    return closest_vowel

def max_fill(grid, capacity):
    bucket_trips = 0
    for row in grid:
        row_water_units = sum(row)
        bucket_trips += -(-row_water_units // capacity)  # Ceiling division per well
    return bucket_trips

def match_parens(lst):
    str1, str2 = lst
    # Try both possible concatenations
    for s1, s2 in [(str1, str2), (str2, str1)]:
        combined = s1 + s2
        balance = 0
        for char in combined:
            if char == '(':
                balance += 1
            else:
                balance -= 1
            # If at any point balance goes negative, parentheses are not balanced
            if balance < 0:
                break
        # If balance is 0 after processing the entire string, it's a good string
        if balance == 0:
            return 'Yes'
    return 'No'

