    extended_a = a + a
    for i in range(len(b)):
        rotated_b = b[i:] + b[:i]
        if rotated_b in extended_a:
            return True
    return False

from heapq import heappop, heappush

def minPath(grid, k):
    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]  # Right, Down, Up, Left

    def neighbors(r, c):
        for dr, dc in moves:
            nr, nc = r + dr, c + dc
            if 0 <= nr < N and 0 <= nc < N:
                yield nr, nc

    # Priority queue: (path length, path cost, row, col, path as list)
    pq = [(0, grid[r][c], r, c, [grid[r][c]]) for r in range(N) for c in range(N)]
    min_cost_path = []

    while pq:
        length, cost, r, c, path = heappop(pq)
        if length == k - 1:
            if not min_cost_path or path < min_cost_path:
                min_cost_path = path
            continue
        for nr, nc in neighbors(r, c):
            new_path = path + [grid[nr][nc]]
            if length + 1 <= k - 1:
                heappush(pq, (length + 1, cost + grid[nr][nc], nr, nc, new_path))
    return min_cost_path

